import "./Details.css"

export const StaffList = () => {

    const [staff, setStaff] = useState([])
    const [staffTitles, setTitle] = useState([])

    useEffect(
        () => {
            fetch(`http://localhost:8088/staff?&_expand=user`)
                .then(response => response.json())
                .then((staffArray) => {
                    setStaff(staffArray)
                })
